import React from "react";

export default function MapList(props) {
  return (
    <div>
    {props
      .filter(id => id.id === props.id)
      .map(album => (
          <ol>
              {album.tracks.map(
                  track =>
              <li>{track}</li>
              )}
          </ol>
      ))
      }
  </div>
  )}
